import React from "react";

type Props = {
  title: string;
  min: number;
  max: number;
};

const PokemonStats = ({ title, min, max }: Props) => {
  return (
    <div className="grid grid-cols-4">
      <span>{title}</span>
      <span>{min}</span>
      <div>Status Bar</div>
      <span>{max}</span>
    </div>
  );
};
export default PokemonStats;
